import React from "react";
import Home from "./Components/Home";
import NavigationBar from './Components/NavigationBar';
import {Route , Routes} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={NavigationBar} />
      </Routes>
    </div>
  );
}

export default App;
